// UserTable.js
 
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom
import { getAllUserApi } from '';

 
export const UserTable = () => {
  const [users, setUsers] = useState([]);
 
  useEffect(() => {
    getAllUserApi()
      .then((res) => {
        console.log(res.data);
        setUsers(res.data.data);
      })
      .catch((error) => {
        console.error('Error fetching user data:', error);
      });
  }, []);
 
  return (

    <>
     <nav className="navbar">
      <div className="navbar-left">
        <span><a className="nav-link" href='/home'>
                  Home
                </a></span>
        <span><a className="nav-link" href='/home'>
                  Restaurant
                </a></span>
        <span><a  className="nav-link" href='/admindash'>Admin</a></span>
      </div>
      <div className="navbar-center">
        <h3 style={{color:'green',fontWeight:'bolder'}}>Yummy Wheels</h3>
      </div>
      <div className="navbar-right">
      <Link
                    className="btn btn-outline-primary me-2"
                    to="/login"
                  >
                    Login
                  </Link>
                  <Link className="btn btn-outline-success" to="/register">
                    Register
                  </Link>
                
      </div>
    </nav>
     <div className="m-4">
      {/* Back Button */}
      <Link to="/admindash">
      <button type="button" className="btn btn-success  butn" style={{marginBottom:'3%'}}>
                Back 
              </button>
      </Link>
      <h1 className="main-text" style={{ color: 'green', 
  color: 'rgba(2, 53, 2, 0.819)',marginBottom:'3%' }}>User Details</h1>
 
      <table  className="table mt-2 ">
        <thead  className="table-success" >
          <tr>
            {/* <th>User ID</th> */}
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Action</th>
            {/* Add more columns as needed */}
          </tr>
        </thead>
        <tbody>
          {users &&
            users.map((userData) => (
              <tr key={userData._id.$oid}>
                {/* <td>{userData._id.$oid}</td> */}
                <td>{userData.firstName}</td>
                <td>{userData.lastName}</td>
                <td>{userData.email}</td>
                <td>
                  <div className="btn-group" role="group">
                    <Link to={''} className="btn btn-success">Edit</Link>
                    <button onClick={''} className="btn btn-danger">Delete</button>
                  </div>
                </td>
                {/* Add more cells as needed */}
              </tr>
            ))}
        </tbody>
      </table>
      </div>
    </>
  );
};
